SET NAMES utf8;
SET sql_mode = 'NO_AUTO_VALUE_ON_ZERO';

DROP TABLE IF EXISTS postcodes_geolocation;
CREATE TABLE `postcodes_geolocation` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `postcode` mediumint unsigned NOT NULL,
  `latitude` decimal(6,3) DEFAULT NULL,
  `longitude` decimal(6,3) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `UNIQUE` (`postcode`)
) ENGINE=InnoDB AUTO_INCREMENT=33485 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci



COMMIT;
